import React from 'react';
import PageBase from '../../../utilities/PageBase/PageBase';
import './StaffManagement.style.scss';
import { SearchOutlined } from '@ant-design/icons';
import { Input, Row, Col } from 'antd';


export default class StaffManagement extends PageBase {
  render() {
    return (
      <div className="staff-management">
        <div className="staff-management__header">
          <Input prefix={<SearchOutlined style={{ marginRight: 5 }} />} placeholder="Tìm kiếm nhân viên..." />
        </div>
        <div className="staff-management__body">
          <div className="staff-management__body__staffs">
            <Row>
              <Col span={8}>
                <div className="staff-management__body__staffs__basic-info">

                </div>
              </Col>
              <Col span={16}></Col>
            </Row>
          </div>
        </div>
      </div>
    )
  }
}
